const LevelCard = (props) => {
    return (
        <div className="flex justify-center items-center w-44 h-16 mx-1 bg-gray-800 rounded-md">
            <h1 className="text-sm font-bold text-center text-white">{props.name}</h1>
        </div>
    );
}

export default LevelCard;
